import { useRemoteNewsTop } from "../hooks/remoteHooks";
import News from "./News";
import Footer from "./footer";

function NewsTop() {
  const [topNews] = useRemoteNewsTop();

  return (
    <>
      <div>
        {topNews.map((news) => (
          <News key={news.id} noticias={news}></News>
        ))}
      </div>
      <Footer />
    </>
  );
}

export default NewsTop;
